import logo from './logo.svg';
import './css/App.css';
import './css/main.css';
import './css/contents.css';
import './css/cssset.css';

function App() {
  return (
      <header className="">
        <p className="ali_center mt100">あいうえお</p>
        <input type="text" name="atext" value={this.state.text}
                       onChange={(e) => this.setState({text: e.target.value})}/>
        <button className="ali_center mt20">aaaa</button>
      </header>
  );
}

export default App;
